window.bookSummaryJSON = "<p><b>Kiss. Marry. Kill</b></p> <p><b>Kill?</b> That's easy. My family runs a murder-for-hire business. I can end a man in my sleep without so much as taking off my eye mask.</p> <p><b>Marry?</b> If my mother has her way, I'll be walking down the aisle with her rival's psychopath son. But Riddick is more likely to stab me during his vows than love and cherish me for a lifetime.</p> <p><b>Kiss?</b> My history with men says I'm better off with a vibrator. But then Augie Mitchell looks at me with his ocean blue eyes and I want to let him prove he's as talented with his tongue as he claims to be.</p> <p>Shame he's my missing sister's best friend and number one on my suspect list. I'd stick with battery operated orgasms, but the man gets under my skin and worse, worms his way into my heart.</p> <p>Until a new target is given to me.</p> <p><b>Augie Mitchell must die.</b></p> <p><b>And I'm the one who has to kill him.</b></p> <p><i>Killer Kiss is a male/female dark romantic suspense story set in the Saint View world. Each book in this series has a new couple and a happily ever after. It can be listened to as a standalone. It contains dark themes that may be triggering for some listeners.</i></p>"; 
